INSERT INTO `master_item` (`kode_item`, `jenis`, `kategori`, `satuan`, `merk`, `nama_item`, `keterangan`, `lokasi`, `gambar`, `harga_jual`, `waktu_update`, `upah_peracik`, `aturan_pakai`, `stok`) VALUES
('8999909028213', 'obat', 'Herbal', 'Botol', 'Acne', 'AFI SALEP 15 GRAM', 'Digunakan untuk mengobati kudis, koreng dan gatal-gata', 'Rak B', '8999909028213.jpg', 5000, '2022-12-23 15:04:12', 0, '', 0),
('8999909028215', 'obat', 'Herbal', 'Tube', 'Ambeven', 'BETASON KRIM 5 GRAM', 'Obat kulit yang berfungsi untuk meredakan peradangan kulit yang disebabkan oleh mikroorganisme, eksema, psoriasis, dan alergi.', 'Rak B', '8999909028215.jpg', 9000, '2022-12-23 15:04:25', 0, '', 0),
('8999909028216', 'obat', 'Herbal', 'Botol', 'Ambeven', 'ABIXA 10 MG TABLET', 'Abixa mengandung Memantine Hydrochloride yang digunakan untuk membantu mengobati demensia pada pasien alzheimer', 'Rak B', '8999909028216.jpg', 33000, '2022-12-23 15:04:30', 0, '', 0),
('8999909028217', 'obat', 'Herbal', 'Botol', 'Acne', 'ABBOTIC XL 500 MG TABLET', 'Mengandung clarithromycin/klaritomisin digunakan untuk mengobati infeksi yang disebabkan oleh bakteri terutama pada saluran pernapasan, kulit dan telinga . Selain itu, kombinasi dengan obat lain digunakan untuk mengobati gangguan pada lambung yang disebabkan oleh bakteri Helicobacter pylori.', 'Rak B', '8999909028217.jpg', 50000, '2022-12-23 15:04:36', 0, '', 0),
('8999909028218', 'obat', 'Herbal', 'Tablet', 'Acne', 'A-B VASK 10 MG BOX 100 TABLET', 'Untuk pengobatan hipertensi (tekanan darah tinggi), angina stabil kronik, pengobatan pasien yang pasti atau diduga menderita angina vasospastik (angina varian)', 'Rak B', '8999909028218.jpg', 350000, '2022-12-23 15:04:42', 0, '', 0),
('8999909028219', 'obat', 'Obat', 'Tablet', 'Bintang Toedjo', '3TC-HBV 100 MG TABLET', 'Mengandung lamivudin untuk mengobati infeksi hepatitis B kronik dengan bukti adanya replikasi virus hepatitis B', 'Rak B', '8999909028219.jpg', 18000, '2022-12-23 15:04:47', 0, '', 0),
('8999909028220', 'obat', 'Herbal', 'Botol', 'Bintang Toedjo', 'COOLANT 350 ML BOTOL', 'Coolant merupakan minuman dari ekstrak Chrysantemum dan ekstrak bengkuang yang dapat melancarkan metabolisme tubuh ketika keadaan gerah sehiingga aktifitas kembali lancar.', 'Rak B', '8999909028220.jpg', 6500, '2022-12-23 15:04:51', 0, '', 0),
('8999909028221', 'obat', 'Herbal', 'Box', 'Acne', 'BONEETO 5-12 TAHUN RASA COKLAT 700 GRAM', 'Susu rasa coklat ini merupakan salah satu makanan pokok bagi tubuh bayi karena masa kecil akan menentukan perkembangan anak, gunakan apabila memang diharuskan bagi anak usia 5-12 tahun.', 'Rak B', '8999909028221.jpg', 80000, '2022-12-23 15:04:56', 0, '', 0),
('8999909028222', 'obat', 'Herbal', 'Box', 'Cussons', 'APPETON WEIGHT GAIN DEWASA RASA VANILA 900 GRAM KALENG', 'Appeton Weight Gain Adult merupakan susu formula yang edilengkapi dengan whey protein yang akan membantu Anda untuk mendapatkan berat badan ideal bagi Anda yang memiliki berat badan yang kurang dari proporsional badan Anda.', 'Rak B', '8999909028222.jpg', 460000, '2022-12-23 15:05:01', 0, '', 0),
('8999909028223', 'obat', 'Herbal', 'Box', 'Acne', 'ANLENE ACTIFIT RASA COKELAT 250 GRAM', 'Anlene Actifit merupakan susu berkalsium tinggi yang rendah lemak diformulasikan dengan formula Movemax khusus untuk wanita dan pria usia 19-50 tahun agar Anda dapat tetap bergerak aktif demi diri sendiri dan orang yang kamu sayangi.\r\n\r\n', 'Rak B', '8999909028223.jpg', 35000, '2022-12-23 15:05:07', 0, '', 0),
('8999909028224', 'obat', 'Herbal', 'Botol', 'Bintang Toedjo', 'AL SHIFA MADU ARAB 250 GRAM', 'Al shifa madu arab merupakan madu asli arab yang sangat baik untuk stamina dan pengobatan penyakit\r\n\r\n', 'Rak B', '8999909028224.jpg', 64000, '2022-12-23 15:05:14', 0, '', 0),
('8999909028226', 'obat', 'Kecantikan', 'Botol', 'Cussons', 'ACANTHE SUNSCREEN SPF30 30 GRAM KRIM', 'Tabir surya yang digunakan untuk kulit normal hingga kering, berfungsi untuk mencegah bintik-bintik dan penuaan dini akibat dari paparan sinar matahari. Formula tabis surya khusus yang bebas PABA mengandung kombinasi tabir surya ganda, yang dapat melindungi kulit anda dari bahaya UV-A dan UV-B\r\n\r\n', 'Rak A', '8999909028226.jpg', 84000, '2022-12-23 15:05:22', 0, '', 0),
('8999909028227', 'obat', 'Kecantikan', 'Tube', 'Cussons', 'ANTIPLAQUE PASTA GIGI 75 GRAM TUBE', 'Antiplaque pasta gigi dapat membantu membersihkan daerah gigi sehingga mencegah terjadinya plak, gigi berlubang, gusi berdarah, radang gusi dan masalah gigi lainnya.\r\n\r\n', 'Rak A', '8999909028227.jpg', 25000, '2022-12-23 15:05:27', 0, '', 0),
('8999909028228', 'obat', 'Kecantikan', 'Botol', 'Acne', 'ALYSSA ASHLEY WHITE MUSK BODY LOTION 750 ML BOTOL', 'Alyssa ashley putih merupakan body lotion untuk membantu menutrisi kulit dari dalam,menjadikan kulit halus,bersinar,putih dan memudarkan noda hitam yang terbuat dari bahan alami sehingga aman tanpa efek samping.\r\n\r\n', 'Rak A', '8999909028228.jpg', 148000, '2022-12-23 15:05:33', 0, '', 0),
('8999909028231', 'obat', 'Herbal', 'Botol', 'Bintang Toedjo', 'BIO GOLD GAMAT EMAS 350 GRAM', 'Bio Gold Gamat merupakan suplemen yang berasal dari teripang dan berfungsi untuk memelihara kesehatan tubuh.', 'Rak A', '8999909028231.jpg', 160000, '2022-12-23 15:05:47', 0, '', 0),
('8999909028232', 'obat', 'Herbal', 'Botol', 'Bintang Toedjo', 'BINTANG TOEDJOE MASUK ANGIN PLUS 4 TUBE', 'Bintang toedjoe masuk angin plus membantu meredakan masuk angin, pegal-pegal dan demam', 'Rak A', '8999909028232.jpg', 8000, '2022-12-23 15:05:53', 0, '', 0),
('8999909028233', 'obat', 'Herbal', 'Botol', 'Ambeven', 'BALPIRIK BALSEM GOSOK EXTRA KUAT HIJAU 20 GRAM', 'Balpirik berbentuk balsem yang sangat cocok digunakan untuk meringankan berbagai gejala penyakit dan kondisi seperti penyakit flu (hidung tersumbat, bersin-bersin, pusing, sakit kepala), perut kembung karena masuk angin, mabuk perjalanan, gatal-gatal akibat gigitan serangga, pegal-pegal, encok dan kram otot.', 'Rak A', '8999909028233.jpg', 7000, '2022-12-23 15:05:57', 0, '', 0),
('8999909028234', 'obat', 'Herbal', 'Botol', 'Cussons', 'Cussons Baby Telon Oil Plus 60 Ml', 'Memberikan perlindungan 8 jam non stop terhadap gigitan nyamuk (tanpa harus dipakai ulang), karena kombinasi bahan alami pilihan yang telah dipercaya mampu mencegah gigitan nyamuk, sehingga tidak saja aman dan nyaman bagi si kecil namun untuk seluruh keluarga.', 'Rak A', '8999909028234.jpg', 27000, '2022-12-23 15:06:01', 0, '', 0),
('8999909028235', 'obat', 'Herbal', 'Botol', 'Cussons', 'AIR MANCUR PARCOK 75 ML', 'Membantu meredakan nyeri otot, persendian, dan pegal linu.', 'Rak A', '8999909028235.jpg', 15000, '2022-12-23 15:06:04', 0, '', 0),
